import React from 'react';
import ReactDOM from 'react-dom/client';
import { BrowserRouter, Route, Routes } from 'react-router-dom';

import './index.css';

import PagesLayout from './components/PagesLayout';

import CountryList from './pages/CoountryList';
import CountryPage from './pages/CoountryPage';

const root = ReactDOM.createRoot(document.getElementById('root'));
root.render(
  <BrowserRouter>
    <Routes>
      <Route path={`${process.env.REACT_APP_FRONT_URL}/`} element={<PagesLayout/>}>
          <Route index path={`${process.env.REACT_APP_FRONT_URL}/`} element={<CountryList />} />
          <Route path={`${process.env.REACT_APP_FRONT_URL}/Country/:country`} element={<CountryPage />}/>
      </Route>
    </Routes>
  </BrowserRouter>
);
